    const SettingsWrapper = styled.div`
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    width: 100%;
    height: 100%;
    `
    return (
        <SettingsWrapper>
        </SettingsWrapper>
    )
}

export default Settings
